        secDerParLSdeg3[0][2] += dFact * matrix2multiply(alpha3, beta3, vectX3);
        secDerParLSdeg3[0][3] += dFact * matrix2multiply(alpha3, beta3, vectY3);
        secDerParLSdeg3[0][4] += dFact * matrix2multiply(alpha3, betaX3, vect3);
