    /**
     * Double matrix multiplication of the form Vect1 x Mat x Vect3
     * 
     * @param mat1
     *        first line vector matrix
     * @param mat2
     *        2nd matrix
     * @param mat3
     *        3rd column vector matrix
     * @return multiplication result
     */
    private double matrix2multiply(final double[] mat1, final double[][] mat2, final double[] mat3) {

        final int n2 = mat2.length;
        final int p2 = mat2[0].length;

        final double[] matTemp = new double[p2];

        for (int j = 0; j < p2; j++) {
            matTemp[j] = 0;
            for (int k = 0; k < n2; k++) {
                matTemp[j] += mat1[k] * mat2[k][j];
            }
        }

        double result = 0;
        for (int k = 0; k < p2; k++) {
            result += matTemp[k] * mat3[k];
        }
        return result;
    }
